import { Icon } from '@iconify/react';
import React, { useEffect } from 'react';
import { pageTitle } from '../../helper';
import Div from '../Div';
import PageHeading from '../PageHeading';
import SectionHeading from '../SectionHeading';
import Spacing from '../Spacing';
import ContactInfoWidget from '../Widget/ContactInfoWidget';
import emailjs from 'emailjs-com';


export default function ContactPage() {
  pageTitle('Contact Us');
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const sendEmail = (e) => {
    e.preventDefault(); // Evitar que el formulario se envíe de la manera convencional

    const templateParams = {
      name: e.target.name.value,
      email: e.target.email.value,
      projectType: e.target.projectType.value,
      phone: e.target.phone.value,
      message: e.target.message.value,
    };


    // Reemplaza 'your_service_id', 'your_template_id', y 'your_user_id' con tus propias credenciales de emailjs
    emailjs.send('FGJN6Ym6JAgrg_F1V', 'template_lioc29m', templateParams, 'service_iqm6tai')
      .then((response) => {
        console.log('Email sent successfully:', response);
        // Aquí puedes agregar lógica adicional después de enviar el correo, como mostrar un mensaje de éxito al usuario
      })
      .catch((error) => {
        console.error('Error sending email:', error);
        // Aquí puedes manejar errores, como mostrar un mensaje de error al usuario
      });
  };


  return (
    <>
      <PageHeading
        title="Contáctanos"
        bgSrc="/images/contact_hero_bg.jpeg"
        pageLinkText="Contacto"
      />
      <Spacing lg="150" md="80" />
      <Div className="container">
        <Div className="row">
          <Div className="col-lg-6">
            <SectionHeading
              title="¿Tienes un proyecto <br/>en mente?"
              subtitle="Estableciendo contacto"
            />
            <Spacing lg="55" md="30" />
            <ContactInfoWidget withIcon />
            <Spacing lg="0" md="50" />
          </Div>
          <Div className="col-lg-6">
            <form action="#" className="row" onSubmit={sendEmail}>
            <Div className="col-sm-6">
  <label className="cs-primary_color">Nombre completo*</label>
  <input type="text" id="name" className="cs-form_field" />
  <Spacing lg="20" md="20" />
</Div>
<Div className="col-sm-6">
  <label className="cs-primary_color">Email*</label>
  <input type="text" id="email" className="cs-form_field" />
  <Spacing lg="20" md="20" />
</Div>
<Div className="col-sm-6">
  <label className="cs-primary_color">Tipo de proyecto*</label>
  <input type="text" id="projectType" className="cs-form_field" />
  <Spacing lg="20" md="20" />
</Div>
<Div className="col-sm-6">
  <label className="cs-primary_color">Celular*</label>
  <input type="text" id="phone" className="cs-form_field" />
  <Spacing lg="20" md="20" />
</Div>
<Div className="col-sm-12">
  <label className="cs-primary_color">Mensaje*</label>
  <textarea id="message" cols="30" rows="7" className="cs-form_field"></textarea>
  <Spacing lg="25" md="25" />
</Div>

              <Div className="col-sm-12">
                <button className="cs-btn cs-style1">
                  <span>Send Message</span>
                  <Icon icon="bi:arrow-right" />
                </button>
              </Div>
            </form>
          </Div>
        </Div>
      </Div>

      <Spacing lg="50" md="40" />
    </>
  );
}
